import { Route, Routes } from 'react-router-dom';
import { publicRoutes } from './Routes';
import { DefaultLayout } from './Componets/Layout';
console.log();
function App() {
  return (
    <div className="App">
      <Routes>
        {publicRoutes.map((route, index) => (
          <Route path={route.path} element={<route.component />} />
        ))}
      </Routes>
    </div>
  );
}

export default App;
